window.bookSummaryJSON = "<p><b>Pirateaba returns once again, bringing you the thrilling seventh installment of chart-topping LitRPG series The Wandering Inn.</b></p> <p>It's raining in Liscor.</p> <p>The spring rains have come and Liscor's entire geography changes with the dawning of the new year. The Floodplains of Liscor live up to their name, and the only way anyone is going to travel is by boat.</p> <p>With the rains come more monsters, dungeon delving, more goblins...not to mention some unwanted attention for the Wandering Inn.</p> <p>Erin Solstice is going further abroad than she's ever dreamed: as far as the Walled City of Pallass, the City of Invention. With the magic door drawing the attention of world powers and the looming crisis of the Goblin Lord, Erin Solstice's inn is busier than ever.</p>"; 
